import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import '../styles/nav.css';

import { HouseDoor, MusicNoteBeamed, Table } from 'react-bootstrap-icons';
import symphonicStepsMainLogo from '../img/symphonicStepsMainLogo.png';

function BsNav() {
  return (
    <Navbar expand="lg" className="bg-light" variant="light">
      <Container fluid>
      <Navbar.Brand href="/MainPage">
  <img
    alt="Symphonic Steps Logo"
    src={symphonicStepsMainLogo}
    className="navbar-logo"
  />
</Navbar.Brand>

        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="/MainPage">
              <HouseDoor /> Home
            </Nav.Link>
            <Nav.Link href="/Datatable">
              <Table /> Data Table
            </Nav.Link>
            <Nav.Link href="/MusicVisualiser">
              <MusicNoteBeamed /> Music Visualiser
            </Nav.Link>
            <Nav.Link href="/InstrumentSelector">
  <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" class="bi bi-guitar" viewBox="0 0 16 16">
    <path d="M15.725 2.146a.5.5 0 0 0-.633-.057L10 .939a.5.5 0 0 0-.76.429v2.21a4.492 4.492 0 0 0-1.5-.999V.368a.5.5 0 0 0-.76-.429l-4.092 1.15a.5.5 0 0 0-.058.633l1.5 2.598a4.487 4.487 0 0 0-1.499 1.5L.439 5.24a.5.5 0 0 0-.057.633l1.15 4.092a.5.5 0 0 0 .429.76h2.21a4.492 4.492 0 0 0 .999 1.5l-1.15 1.15a.5.5 0 0 0 .633.058l4.092-1.15a.5.5 0 0 0 .429-.76V11.79c.559.297 1.182.498 1.5.999h-2.21a.5.5 0 0 0-.429.76l1.15 4.092a.5.5 0 0 0 .633.058l2.598-1.5c.503.318 1.026.568 1.5.999v2.21a.5.5 0 0 0 .76.429l4.092-1.15a.5.5 0 0 0 .058-.633l-1.5-2.598c.431-.474.681-.997.999-1.5h2.21a.5.5 0 0 0 .429-.76l-1.15-4.092a.5.5 0 0 0-.76-.429v2.21a4.492 4.492 0 0 0-.999-1.5l1.15-1.15a.5.5 0 0 0 .058-.633l-2.598-1.5Z"/>
  </svg> Instrument Selector
</Nav.Link>

            <Nav.Link href="/TheoryTrainer">
              Theory Trainer
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default BsNav;
